import React, { useState } from 'react'

const AttributeButton = ({ filter, setAttribute }) => {

    const [ selected, setSelected ] = useState(false);

    return (
        <div className="attribute_button" onClick={() => {setAttribute(selected, filter); setSelected(!selected);}} />
    )
}

export default AttributeButton
